-- 导出  表 automaker.job 结构
DROP TABLE IF EXISTS `job`;
CREATE TABLE IF NOT EXISTS `job` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(255) DEFAULT '0' COMMENT '任务名称',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `primary_svn_path` varchar(255) DEFAULT NULL COMMENT 'svn路径',
  `description` varchar(255) DEFAULT NULL COMMENT '任务描述',
  `status` int(11) DEFAULT NULL COMMENT '0 从未启动 1 运行中 2 运行通过 3 运行警告 4 运行失败 5 任务停用',
  `workspace_path` varchar(255) DEFAULT NULL COMMENT '工作环境目录',
  `host` varchar(50) DEFAULT NULL COMMENT '部署host',
  `port` int(11) DEFAULT NULL COMMENT '部署端口',
  `job_config` text,
  `need_schedule` tinyint(4) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 COMMENT='任务，一个构建方案';

