-- 导出  表 automaker.run_history 结构
DROP TABLE IF EXISTS `run_history`;
CREATE TABLE IF NOT EXISTS `run_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `job_id` int(11) NOT NULL DEFAULT '0' COMMENT 'job id',
  `start_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `spend_time` int(11) DEFAULT NULL,
  `success_count` int(11) DEFAULT NULL,
  `fail_count` int(11) DEFAULT '0',
  `skip_count` int(11) DEFAULT '0',
  `total_count` int(11) DEFAULT '0',
  `end_time` datetime DEFAULT '0000-00-00 00:00:00',
  `run_no` int(11) NOT NULL DEFAULT '0' COMMENT '执行编号',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '执行状态 0 未执行 1 执行中 2 执行暂停 3 执行警告 4 执行成功 5 执行失败',
  PRIMARY KEY (`id`),
  KEY `FK__job` (`job_id`),
  CONSTRAINT `FK__job` FOREIGN KEY (`job_id`) REFERENCES `job` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=307 DEFAULT CHARSET=utf8;

